Basándome en el estilo poético, el uso del lenguaje y los elementos románticos presentes en el poema, puedo identificar con bastante certeza que se trata de un soneto de Gustavo Adolfo Bécquer, poeta español del siglo XIX, conocido por su poesía lírica y sus rimas.
